import React from 'react';
import '../../App.css';
import Button from '../../containers/Buttons/Button';
import 'react-fontawesome';
import {Button as UiButton} from "semantic-ui-react";
import {Link} from "react-router-dom";

/** Home page  */
function Header(props) {
    return (
            <div id={"Header"}>
                <div id={'user-area'} className={'ui segment'}>
                    <p id={'user-name'}>Username</p>
                    <Button
                        buttonText={props.children}
                        action={"showForm"}
                        showElement={'form-element-1'}
                    />
                    <Link to="/">
                        <UiButton>Back</UiButton>
                    </Link>
                </div>
            </div>
    );
}

export default Header;
